import './App.css';
import Main from './book';
import Login from './login';
import { 
  BrowserRouter as Router, 
  Switch, 
  Route,
  Link
} from "react-router-dom"


function App() {
  return(
  <>
  <Router>
      <Switch>
        <div>
          <Login/>
          <Main/>
        </div>
      </Switch>
    </Router>
  </>
  );
}

export default App;
